class Solution {
public:
    bool increasingTriplet(vector<int>& nums) {
        for(int i=0;i<nums.size();i++){
            for(int j=i+1;j<nums.size();j++){
                for(int k=j+1;k<nums.size();k++){
                    if(i<j && j<k && nums[i]<nums[j] && nums[j]<nums[k]) return true;
                }
            }
        }
        return false;
    }
};
